drop table if exists movies;
drop table if exists ratings;
drop table if exists tags;
drop table if exists users;
drop table if exists genres;
drop table if exists tags_content;
drop table if exists movies_genres;

create table movies
(
    id integer(8) primary key,
    title varchar(255),
    year int
);
        
create table ratings
(
    id integer primary key autoincrement,
    user_id  int,
    movie_id  int,
    rating int,
    timestamp int
);
        
create table tags
(
    id integer primary key autoincrement,
    user_id int,
    movie_id int,
    tag_id int,
    timestamp int
);
        
create table users
(
    id integer primary key,
    name varchar(255),
    email varchar(255),
    gender varchar(255),
    register_date date,
    occupation varchar(255)
);


        
create table movies_genres
(
    id integer primary key autoincrement,
    title_id int,
    genre_id int
);


        
create table genres
(
    id integer primary key,
    genre varchar(255)
);


        
create table tags_content
(
    id integer primary key,
    tag varchar(255)
);


 

 

 

 

 

 

 

create index ind_name on users(substr(name, instr(name,' ')+1));
create index ind_title on movies(title);
create index ind_year on movies(year) where year is not null;

        